// Configure an ML pipeline, which consists of two stages on one column: a StringIndexer and a OneHotEncoder.
import org.apache.spark.ml.feature.{OneHotEncoder, StringIndexer, VectorAssembler}
import org.apache.spark.ml.{Pipeline, PipelineModel}

// Fonction retournant une séquence de StringIndexer & OneHotEncoder pour un nom de catégorie donné
def makeSeq(w: String) = {

    // w = nom de la colonne à traiter

    // Construction de notre StringIndexer
    // Le nom de colonne existante à mapper en entrée est indiqué via setInputCol
    // Le nom de colonne en sortie est celui indiqué en entrée suffixé par "Index"
    val stringIndexer = new StringIndexer()
      .setInputCol(w)
      .setOutputCol(w+"Index")

    // Construction de notre OneHotEncoder
    // Le nom de colonne à mapper en entrée est celui en sortie du StringIndexer précédemment créé.
    // Le nom de colonne en sortie est celui de la colonne d'origine suffixé par "ClassVec"
    val oneHotEncoder = new OneHotEncoder()
      .setInputCol(stringIndexer.getOutputCol)
      .setOutputCol(w + "ClassVec")
    Seq(stringIndexer, oneHotEncoder)
}

// Séquence des variables catégorielles non-numériques pour lesquelles nous souhaitons transformer les différents états en vecteurs binaires.
val nonNumericalColumns = Seq("workclass", "education", "marital_status", "occupation", "relationship", "race", "sex", "native_country")

// Création des étapes à destination de notre pipeline ML.
// La méthode flatMap nous permet ici d'appliquer une transformation sur chaque valeur/colonne de nonNumericalColumns
// Pour chaque nom de colonne, nous obtenons une séquence Seq(stringIndexer, oneHotEncoder) représentant cette colonne.
val stages = nonNumericalColumns.flatMap(makeSeq)

// Traitement du label. Il nous permettra de vérifier si nos prédictions sont bonnes par la suite.
// Pour cela, nous devons transformer les différents états de la variable "income" en valeurs numériques (via StringIndexer).
// Pas de transformation one-hot ici car inutile.
val label_stringIdx = new StringIndexer().setInputCol("income").setOutputCol("label")

// Etape d'assemblage des colonnes (suffixées par ClassVec) en un seul vecteur de colonnes appelé "features"
val assemblerStage = new VectorAssembler().setInputCols(nonNumericalColumns.map(w => w + "ClassVec").toArray).setOutputCol("features")

// Regroupement des étapes à destinations du pipeline
val finalStages = stages ++ Seq(label_stringIdx) ++ Seq(assemblerStage)

// Création du pipeline et ajout des étapes
val pipeline = new Pipeline().setStages(finalStages.toArray)

// Applique les étapes du pipeline au jeu de données pour obtenir un model.
val pipelineModel = pipeline.fit(dataset)

// Transformation des données à l'aide du modèle.
// Nous stockons les données transformées pour réutilisation.
val datasetTransformed = pipelineModel.transform(dataset)

// Pour futures requêtes SQL
datasetTransformed.registerTempTable("datasetTransformed")

datasetTransformed.show()

