import org.apache.spark.mllib.linalg._
import org.apache.spark.rdd.RDD
import org.apache.spark.mllib.stat.{MultivariateStatisticalSummary, Statistics}

// Transformation des variables numériques en lignes de vecteurs [Double, Double, Double, ...]
def transform(row: org.apache.spark.sql.Row) = {
    Vectors.dense(
        row.getAs[Double]("workclassIndex"), 
        row.getAs[Double]("educationIndex"), 
        row.getAs[Double]("marital_statusIndex"),
        row.getAs[Double]("occupationIndex"),
        row.getAs[Double]("relationshipIndex"),
        row.getAs[Double]("raceIndex"),
        row.getAs[Double]("sexIndex"),
        row.getAs[Double]("native_countryIndex"),
        row.getAs[Double]("label"))
}

// Récupération des valeurs d'index de nos variables catégorielles et création d'une matrice.
val data = datasetTransformed.select("workclassIndex", "educationIndex", "marital_statusIndex", "occupationIndex","relationshipIndex","raceIndex","sexIndex",
"native_countryIndex","label").rdd.map(transform)

// Corrélation des données en suivant la méthode "pearson"
val correlMatrix: Matrix = Statistics.corr(data, "pearson")

// Affichage de la dernière colonne de notre matrice de corrélation (l'affichage total de la matrice étant tronqué par Zeppelin).
println("Correlation des variables catégorielles avec label")
// Nous itérons sur les 9 lignes de la matrice
for( r <- 0 to 8){
   println(correlMatrix.apply(r,8)) // nous prenons la dernière colonne de la matrice, soit la colonne label.
   // Cela nous donne uniquement les valeurs de corrélation de label avec les autres variables.
}

